import React from "react"

function Admin() {
  return (
    <div className="admin">
      <div className="top-dash">
        <div className="dash-item">Candidates</div>
        <div className="dash-item">Students</div>
        <div className="dash-item">Schools</div>
      </div>
    </div>
  )
}

export default Admin
